    constructor(props) {
        super(props);
        this.state = {
            bid: {}
        }
    }
    componentDidMount() {
        Axios.get("http://localhost:3000/bid")

            .then((result) => {
                this.setState({
                    isLoaded: true,
                    bid: result.data
